“Manning’s confident, powerful paintings hold the tension between the microscopic and macroscopic, drawing viewers into her realm. Reading as neither masculine or feminine, figures emerge from luminous swathes of colour; hands merging into faces, arms into stomachs, guiding the eye around the canvas. As one of five children, ideas of playfulness, intimacy, and chaos within family dynamics are central to Manning’s subject matter.” - Saskia Flower

Thank you so much to @saskia_flower for writing so beautifully about this body of work, I’ve been so looking forward to sharing it with the world and your text is such an eloquent window into these pieces!!

